import * as React from "react";
import { AppBar, Toolbar, Typography, Box, Button, IconButton } from "@mui/material";
import { Link } from "react-router-dom";

export default function NavigationBar() {
  return (
    <AppBar position="static" color="default" elevation={1} sx={{ backgroundColor: "#fff" }}>
      <Toolbar
        sx={{
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          paddingX: 4,
        }}
      >
        {/* Logo on the Left */}
        <Box
          component={Link}
          to="/new"
          sx={{
            textDecoration: "none",
            color: "inherit",
            display: "flex",
            alignItems: "center",
            gap: "10px",
          }}
        >
          <Box
            sx={{
              width: 40,
              height: 40,
              backgroundColor: "#ccc",
              borderRadius: "50%",
            }}
          />
          <Typography
            variant="h6"
            sx={{
              fontWeight: "bold",
              textTransform: "uppercase",
            }}
          >
            Logo Placeholder
          </Typography>
        </Box>

        {/* Navigation Links */}
        <Box
          sx={{
            display: "flex",
            gap: 3,
          }}
        >
          <Button
            component={Link}
            to="/venues"
            color="inherit"
            sx={{ textTransform: "uppercase", fontWeight: 500, fontSize: "14px" }}
          >
            Venues
          </Button>
          <Button
            component={Link}
            to="/hair"
            color="inherit"
            sx={{ textTransform: "uppercase", fontWeight: 500, fontSize: "14px" }}
          >
            Hair
          </Button>
          <Button
            component={Link}
            to="/makeup"
            color="inherit"
            sx={{ textTransform: "uppercase", fontWeight: 500, fontSize: "14px" }}
          >
            Makeup
          </Button>
          <Button
            component={Link}
            to="/photographers"
            color="inherit"
            sx={{ textTransform: "uppercase", fontWeight: 500, fontSize: "14px" }}
          >
            Photographers
          </Button>
          <Button
            component={Link}
            to="/music"
            color="inherit"
            sx={{ textTransform: "uppercase", fontWeight: 500, fontSize: "14px" }}
          >
            Music
          </Button>
          <Button
            component={Link}
            to="/florist"
            color="inherit"
            sx={{ textTransform: "uppercase", fontWeight: 500, fontSize: "14px" }}
          >
            Florist
          </Button>
          <Button
            component={Link}
            to="/dresser"
            color="inherit"
            sx={{ textTransform: "uppercase", fontWeight: 500, fontSize: "14px" }}
          >
            Dresser
          </Button>
          <Button
            component={Link}
            to="/planner"
            color="inherit"
            sx={{ textTransform: "uppercase", fontWeight: 500, fontSize: "14px" }}
          >
            Planner
          </Button>
        </Box>

        {/* Shopping Cart Icon on the Right */}
        <IconButton
          component={Link}
          to="/cart"
          color="inherit"
          sx={{
            padding: 1,
          }}
        >
          <ShoppingCartIcon />
        </IconButton>
      </Toolbar>
    </AppBar>
  );
}
